import Crumbs from "../Crumbs/Crumbs";
import Header from "../Header/Header";
import Catalog from "../Catalog/Catalog";

export default function CatalogPage({ onCardClick, products }) {
  return (
    <>
    <Header/>
    <Crumbs/>
    <Products
            onCardClick={onCardClick}
            products={products}
    ></Products>
    </>
  )
}
